        if (Imports.FunctionMap != null)
        {
        }

        ReloadFunctions();
    }

    public static bool IsExtensionSupported(string name)
    {
        if (rebuildExtensionList)
        {
            BuildExtensionList();
        }

        lock (gl_lock)
        {
            sb.Remove(0, sb.Length);
            if (!name.StartsWith("GL_"))
            {
                sb.Append("gl_");
            }

            sb.Append(name.ToLower());
            return AvailableExtensions.ContainsKey(sb.ToString());
        }
    }

    public static Delegate GetDelegate(string name, Type signature)
    {
        MethodInfo value;
        return GetExtensionDelegate(name, signature) ?? (Imports.FunctionMap.TryGetValue(name.Substring(2), out value) ? Delegate.CreateDelegate(signature, value) : null);
    }

    public static void ReloadFunctions()
    {
        if (delegates == null)
        {
            delegates = delegatesClass.GetFields(BindingFlags.Static | BindingFlags.NonPublic);
        }

        FieldInfo[] array = delegates;
        foreach (FieldInfo fieldInfo in array)
        {
            fieldInfo.SetValue(null, GetDelegate(fieldInfo.Name, fieldInfo.FieldType));
        }

        rebuildExtensionList = true;
    }

    private static void set(object d, Delegate value)
    {
        d = value;
    }

    public static bool Load(string function)
    {
        FieldInfo field = delegatesClass.GetField(function, BindingFlags.Static | BindingFlags.NonPublic);
        if ((object)field == null)
        {
            return false;
        }

        Delegate @delegate = field.GetValue(null) as Delegate;
        Delegate delegate2 = GetDelegate(field.Name, field.FieldType);
        if (@delegate.Target != delegate2.Target)
        {
            field.SetValue(null, delegate2);
            rebuildExtensionList = true;
        }

        return (object)delegate2 != null;
    }

    private static void BuildExtensionList()
    {
        AvailableExtensions.Clear();
        string text = glGetString(7938);
        if (string.IsNullOrEmpty(text))
        {
            throw new ApplicationException("Failed to retrieve OpenGL version. Is there an opengl context current?");
        }

        string text2;
        if (text.ToLower().Contains("mesa"))
        {
            int num = text.IndexOf('(');
            text2 = ((num == -1) ? text.TrimStart(' ') : text.Substring(num + 1, 3));
        }
        else
        {
            text2 = text.TrimStart(' ');
        }

        if (text2.StartsWith("1.2"))
        {
            AvailableExtensions.Add("gl_version_1_1", value: true);
            AvailableExtensions.Add("gl_version_1_2", value: true);
        }
        else if (text2.StartsWith("1.3"))
        {
            AvailableExtensions.Add("gl_version_1_1", value: true);
            AvailableExtensions.Add("gl_version_1_2", value: true);
            AvailableExtensions.Add("gl_version_1_3", value: true);
        }
        else if (text2.StartsWith("1.4"))
        {
            AvailableExtensions.Add("gl_version_1_1", value: true);
            AvailableExtensions.Add("gl_version_1_2", value: true);
            AvailableExtensions.Add("gl_version_1_3", value: true);
            AvailableExtensions.Add("gl_version_1_4", value: true);
        }
        else if (text2.StartsWith("1.5"))
        {
            AvailableExtensions.Add("gl_version_1_1", value: true);
            AvailableExtensions.Add("gl_version_1_2", value: true);
            AvailableExtensions.Add("gl_version_1_3", value: true);
            AvailableExtensions.Add("gl_version_1_4", value: true);
            AvailableExtensions.Add("gl_version_1_5", value: true);
        }
        else if (text2.StartsWith("2.0"))
        {
            AvailableExtensions.Add("gl_version_1_1", value: true);
            AvailableExtensions.Add("gl_version_1_2", value: true);
            AvailableExtensions.Add("gl_version_1_3", value: true);
            AvailableExtensions.Add("gl_version_1_4", value: true);
            AvailableExtensions.Add("gl_version_1_5", value: true);
            AvailableExtensions.Add("gl_version_2_0", value: true);
        }
        else if (text2.StartsWith("2.1"))
        {
            AvailableExtensions.Add("gl_version_1_1", value: true);
            AvailableExtensions.Add("gl_version_1_2", value: true);
            AvailableExtensions.Add("gl_version_1_3", value: true);
            AvailableExtensions.Add("gl_version_1_4", value: true);
            AvailableExtensions.Add("gl_version_1_5", value: true);
            AvailableExtensions.Add("gl_version_2_0", value: true);
            AvailableExtensions.Add("gl_version_2_1", value: true);
        }

        string text3 = glGetString(7939);
        if (!string.IsNullOrEmpty(text3))
        {
            string[] array = text3.Split(new char[1] { ' ' }, StringSplitOptions.RemoveEmptyEntries);
            string[] array2 = array;
            foreach (string text4 in array2)
            {
                AvailableExtensions.Add(text4.ToLower(), value: true);
            }

            rebuildExtensionList = false;
        }
    }

    private static IntPtr GetAddress(string function)
    {
        if (getProcAddress == null)
        {
            if (Environment.OSVersion.Platform == PlatformID.Win32NT || Environment.OSVersion.Platform == PlatformID.Win32S || Environment.OSVersion.Platform == PlatformID.Win32Windows || Environment.OSVersion.Platform == PlatformID.WinCE)
            {
                getProcAddress = new GetProcAddressWindows();
            }
            else
            {
                if (Environment.OSVersion.Platform != PlatformID.Unix && Environment.OSVersion.Platform != PlatformID.Unix)
                {
                    throw new PlatformNotSupportedException("Extension loading is only supported under Mac OS X, Unix/X11 and Windows. We are sorry for the inconvience.");
                }

                switch (DetectUnixKernel())
                {
                    case "Unix":
                    case "Linux":
                        getProcAddress = new GetProcAddressX11();
                        break;
                    case "Darwin":
                        getProcAddress = new GetProcAddressOSX();
                        break;
                    default:
                        throw new PlatformNotSupportedException(DetectUnixKernel() + ": Unknown Unix platform - cannot load extensions. Please report a bug at http://taoframework.com");
                }
            }
        }

        return getProcAddress.GetProcAddress(function);
    }

    private static string DetectUnixKernel()
    {
        ProcessStartInfo processStartInfo = new ProcessStartInfo();
        processStartInfo.Arguments = "-s";
        processStartInfo.RedirectStandardOutput = true;
        processStartInfo.RedirectStandardError = true;
        processStartInfo.UseShellExecute = false;
        string[] array = new string[3] { "/usr/bin/uname", "/bin/uname", "uname" };
        foreach (string fileName in array)
        {
            try
            {
                processStartInfo.FileName = fileName;
                Process process = Process.Start(processStartInfo);
                StreamReader standardOutput = process.StandardOutput;
                return standardOutput.ReadLine().Trim();
            }
            catch (FileNotFoundException)
            {
            }
            catch (Win32Exception)
            {
            }
        }

        return null;
    }

    internal static Delegate GetExtensionDelegate(string name, Type signature)
    {
        IntPtr address = GetAddress(name);
        if (address == IntPtr.Zero || address == new IntPtr(1) || address == new IntPtr(2))
        {
            return null;
        }

        return Marshal.GetDelegateForFunctionPointer(address, signature);
    }
}